/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `ActualizarStock` AFTER INSERT ON `detalle_pedidos` FOR EACH ROW BEGIN
    -- Actualiza el stock del producto correspondiente
    UPDATE productos
    SET stock = stock - NEW.cantidad
    WHERE producto_id = NEW.producto_id;

    -- Verifica el valor del stock después de la actualización
    SELECT stock INTO @stock_actualizado
    FROM productos
    WHERE producto_id = NEW.producto_id;

    -- Opcional: Comprobar si el stock es bajo y registrar una alerta
    IF @stock_actualizado < 10 THEN
        INSERT INTO alertas_stock (producto_id, mensaje, fecha_alerta)
        VALUES (NEW.producto_id, 'Stock bajo. Necesita reabastecimiento.', NOW());
    END IF;
END */;;
DELIMITER ;
