CREATE DEFINER=`root`@`localhost` PROCEDURE `p_clientes_top`()
BEGIN
	SELECT c.nombre, c.apellido, SUM(p.monto_total) AS Gastos 
	FROM clientes c 
	JOIN pedidos p ON c.cliente_id = p.cliente_id 
	GROUP BY c.nombre,c.apellido 
	HAVING Gastos > 5000 
	ORDER BY Gastos DESC;
END ;;
